import reactLogo from '../media/reactLogo.png';
import '../styles/About.css';
import '../components/SideMenu';
function About() {
  return (
    <div className="page About">
      <SideMenu />
      <img src={reactLogo} className="reactLogo" />
    </div>
  );
}

export default About;
